import React from "react"

const ListItem =({ date, name, description, assigned, status }) => {
    return(
        <div>
            <p>{date}</p>
            <p>{name}</p>
            <p>{description}</p>
            <p>{assigned}</p>
            <p>{status}</p>
        </div>
    )
}

export default ListItem;
